import { useNavigate } from 'react-router-dom'

import useShops from '@/hooks/shopping/useShops'

const ShoppingMainPage = () => {
  const navigage = useNavigate()
  const { data: shops } = useShops()
  return (
    <div style={{ padding: '20px 10px', display: 'flex', flexDirection: 'column', alignItems: 'flex-start', gap: '10px' }}>
      <h2>Shopping</h2>
      <button onClick={() => navigage('shop/create')}>상점 만들기</button>
      <h3>Shop</h3>
      { shops?.map((shop) => <div key={shop.id}></div>)}
    </div>
  )
}
export default ShoppingMainPage
